import React from 'react';

const Text = (props) =>{
    const buttonStyle = {
        backgroundColor : 'yellow',
        color: 'white',
        padding : '8px',
        textAlign : 'center',
        cursor : 'pointer',
        border : '1px solid black'
     }

    return(
        <div>
            { props.textLength > 5 ?
            <h4>Text length is enough</h4>
         : 
        <h4>Text length is short</h4>
        }  
        <h1>{props.textLength}</h1>
        <button style={buttonStyle}>Zic</button>
        </div>
    )
}

export default Text;
